r($,"b6M","HX",()=>{var q="Jawa Barat",p="Jawa",o="Alat Musik Perkusi",n="Alat Musik Dawai",m="assets/sound/",l="Minangkabau",k=t.s
return A.a([A.hL("Alat Musik Getar","Angklung adalah alat musik tradisional yang terbuat dari bambu dan dimainkan dengan cara digoyangkan sehingga menghasilkan nada yang khas. Alat musik ini memiliki beberapa tabung bambu yang disusun vertikal dan dirangkai dengan tali. Ketika digoyangkan, tabung-tabung bambu ini akan berbenturan dan menghasilkan suara harmonis. Angklung sering dimainkan dalam grup, menciptakan komposisi musik yang kaya dan kompleks. Alat musik ini juga sering digunakan dalam upacara adat dan acara kebudayaan di Jawa Barat.","Angklung memiliki sejarah panjang yang berasal dari masyarakat Sunda di Jawa Barat. Alat musik ini sudah ada sejak zaman kerajaan Sunda dan digunakan dalam berbagai ritual keagamaan untuk memanggil Dewi Sri, dewi kesuburan. Pada abad ke-20, angklung mengalami transformasi dengan penambahan sistem tangga nada diatonis oleh Daeng Soetigna, sehingga dapat dimainkan dalam musik modern dan menjadi lebih populer secara global.","assets/images/angklung.png",A.a(["assets/image_detail/angklung1.jpg","assets/image_detail/angklung2.jpeg","assets/image_detail/angklung3.jpeg"],k),"Angklung",q,"assets/sound/angklung.ogg","assets/thumbnail/angklung.jpg"),A.hL(o,"Gamelan adalah ansambel musik tradisional yang berasal dari Jawa, Bali, dan Lombok. Ansambel ini terdiri dari berbagai instrumen seperti gong, kenong, kempul, saron, bonang, dan lainnya, yang semuanya terbuat dari logam. Setiap instrumen dalam gamelan memiliki fungsi tertentu dalam menciptakan komposisi musik yang harmonis dan berirama. Gamelan sering dimainkan dalam acara-acara besar seperti upacara adat, pertunjukan wayang, dan tarian tradisional.","Gamelan memiliki sejarah yang sangat tua dan dipercaya sudah ada sejak masa Kerajaan Hindu-Buddha di Indonesia. Pada awalnya, gamelan digunakan dalam upacara keagamaan di kerajaan-kerajaan tersebut. Seiring waktu, gamelan berkembang menjadi bagian penting dari kebudayaan Jawa dan Bali, dan setiap daerah memiliki variasi gamelan yang unik. Gamelan juga menjadi inspirasi bagi banyak musisi kontemporer di seluruh dunia.","assets/images/gamelan.png",A.a(["assets/image_detail/gamelan1.png","assets/image_detail/gamelan2.png","assets/image_detail/gamelan3.jpg"],k),"Gamelan",p,"assets/sound/gamelan.ogg","assets/thumbnail/gamelan.jpg"),A.hL(n,"Sasando adalah alat musik dawai tradisional yang berbentuk tabung dan terbuat dari daun lontar. Alat musik ini dimainkan dengan cara dipetik seperti harpa, menghasilkan suara yang lembut dan melodius. Sasando memiliki beberapa senar yang diikatkan pada tabung utama, dan bagian resonatornya terbuat dari daun lontar yang berbentuk seperti kipas. Alat musik ini biasanya dimainkan dalam acara-acara adat dan upacara penting di masyarakat Rote, Nusa Tenggara Timur.","Sasando dipercaya sudah ada sejak abad ke-7 di Pulau Rote, Nusa Tenggara Timur. Menurut legenda, alat musik ini pertama kali dibuat oleh seorang pemuda bernama Sangguana yang terinspirasi dari suara angin yang berhembus melalui daun lontar. Sejak itu, sasando menjadi bagian tak terpisahkan dari kebudayaan masyarakat Rote dan terus diwariskan dari generasi ke generasi.","assets/images/sasando.png",A.a(["assets/image_detail/sasando1.jpg","assets/image_detail/sasando2.png","assets/image_detail/sasando3.png"],k),"Sasando","Nusa Tenggara Timur",m,"assets/thumbnail/sasando.png"),A.hL(o,"Kolintang adalah alat musik perkusi yang terbuat dari kayu ringan, seperti kayu telur, dan disusun secara horizontal. Alat musik ini dimainkan dengan cara memukul bilah-bilah kayu yang disusun di atas resonator untuk menghasilkan nada-nada yang harmonis. Kolintang biasanya dimainkan dalam ansambel musik tradisional di Sulawesi Utara, baik dalam upacara adat maupun pertunjukan seni.",'Kolintang berasal dari Minahasa, Sulawesi Utara, dan sudah ada sejak zaman nenek moyang suku Minahasa. Nama "kolintang" berasal dari suara yang dihasilkan alat musik ini, yaitu "tong" (nada rendah), "ting" (nada tinggi), dan "tang" (nada sedang). Awalnya, kolintang digunakan dalam upacara adat dan keagamaan, namun seiring waktu, kolintang juga digunakan dalam pertunjukan musik modern dan menjadi simbol kebanggaan masyarakat Sulawesi Utara.',"assets/images/kolintang.png",A.a(["assets/image_detail/kolintang1.jpeg","assets/image_detail/kolintang2.jpg","assets/image_detail/kolintang3.jpeg"],k),"Kolintang","Sulawesi Utara","assets/sound/kolintang.ogg","assets/thumbnail/kolintang.jpeg"),A.hL("Alat Musik Gesek","Rebab adalah alat musik gesek tradisional yang biasa digunakan dalam pertunjukan gamelan di Jawa. Rebab terbuat dari kayu dengan bagian depan yang dilapisi kulit, dan memiliki dua atau tiga senar yang digesek dengan busur. Suara rebab sangat lembut dan melankolis, sering digunakan untuk mengiringi lagu-lagu atau tarian dalam pertunjukan tradisional.","Rebab merupakan alat musik yang diperkenalkan ke Indonesia oleh pedagang dari Timur Tengah pada abad ke-9. Alat musik ini kemudian diadopsi ke dalam budaya Jawa dan menjadi bagian penting dari ensambel gamelan. Rebab sering digunakan untuk memainkan melodi utama dalam komposisi gamelan dan menjadi instrumen yang sangat dihormati dalam budaya musik tradisional Jawa.","assets/images/rebab.png",A.a(["assets/image_detail/rebab1.jpeg","assets/image_detail/rebab2.jpeg","assets/image_detail/rebab3.png"],k),"Rebab",p,m,"assets/thumbnail/rebab.jpg"),A.hL(n,'Kecapi adalah alat musik petik tradisional yang digunakan dalam musik Sunda, khususnya dalam jenis musik yang disebut "kacapi suling." Kecapi terbuat dari kayu dengan senar logam yang dipetik menggunakan jari. Alat musik ini sering digunakan sebagai instrumen utama dalam musik instrumental Sunda yang lembut dan mendayu-dayu.',"Kecapi sudah dikenal di masyarakat Sunda sejak zaman kerajaan Sunda di Jawa Barat. Alat musik ini sering digunakan dalam upacara adat dan pertunjukan seni tradisional. Seiring dengan perkembangan musik Sunda, kecapi tetap bertahan sebagai instrumen yang penting dan sering dimainkan dalam berbagai konteks, dari musik tradisional hingga modern.","assets/images/kecapi.png",A.a(["assets/image_detail/kecapi1.jpg","assets/image_detail/kecapi2.jpeg"],k),"Kecapi","Sunda",m,"assets/thumbnail/kecapi.jpg"),A.hL(o,"Tifa adalah alat musik perkusi yang dimainkan dengan cara dipukul. Alat musik ini terbuat dari kayu dengan bagian tengah yang dilubangi dan bagian atasnya dilapisi kulit hewan. Tifa menghasilkan suara yang kuat dan sering dimainkan dalam acara adat serta upacara di Maluku dan Papua. Ada berbagai jenis tifa dengan ukuran dan bentuk yang berbeda, yang masing-masing digunakan untuk fungsi yang berbeda dalam masyarakat.","Tifa memiliki sejarah panjang dalam budaya Maluku dan Papua. Alat musik ini digunakan dalam berbagai upacara adat, seperti upacara penyambutan tamu penting, upacara keagamaan, dan upacara perang. Tifa juga sering digunakan untuk mengiringi tarian tradisional seperti tari Cakalele di Maluku dan tari perang di Papua. Alat musik ini menjadi simbol keberanian dan kekuatan dalam budaya masyarakat setempat.","assets/images/tifa.png",A.a(["assets/image_detail/tifa1.png","assets/image_detail/tifa2.jpeg","assets/image_detail/tifa3.jpg"],k),"Tifa","Maluku dan Papua",m,"assets/thumbnail/tifa.png"),A.hL("Alat Musik Tiup","Saluang adalah alat musik tiup tradisional yang terbuat dari bambu tipis. Alat musik ini memiliki bentuk sederhana dengan lubang tiup di salah satu ujungnya dan lubang-lubang kecil untuk mengatur nada. Saluang menghasilkan suara yang melankolis dan sering dimainkan untuk mengiringi syair-syair atau dendang tradisional Minangkabau. Alat musik ini memiliki resonansi khas yang menciptakan suasana sendu dan penuh perasaan.","Saluang berasal dari Sumatera Barat dan merupakan bagian integral dari budaya musik Minangkabau. Sejak zaman dahulu, saluang digunakan dalam upacara adat, terutama dalam acara-acara yang bersifat sakral atau melankolis. Dahulu, saluang dimainkan untuk mengiringi dendang yang menyampaikan cerita-cerita tentang kehidupan, cinta, dan nasihat. Hingga kini, saluang tetap menjadi alat musik yang penting dalam kesenian Minangkabau, meskipun jumlah pemainnya semakin sedikit.","assets/images/saluang.png",A.a(["assets/image_detail/saluang1.jpg","assets/image_detail/saluang2.jpg","assets/image_detail/saluang3.jpg"],k),"Saluang",l,m,"assets/thumbnail/saluang.jpg"),A.hL(o,"Bonang adalah salah satu instrumen utama dalam gamelan Jawa yang terdiri dari deretan gong kecil yang ditempatkan secara horizontal di atas tali di dalam sebuah rangka. Alat musik ini dimainkan dengan cara dipukul menggunakan pemukul kayu yang dibalut kain. Bonang memiliki peran penting dalam gamelan, sering memainkan melodi pembuka dan penutup dalam sebuah komposisi.","Bonang telah ada sejak masa Kerajaan Majapahit dan terus berkembang menjadi salah satu instrumen kunci dalam gamelan Jawa. Alat musik ini dianggap sebagai instrumen yang sakral dan sering digunakan dalam upacara keagamaan serta acara kebudayaan penting. Bonang juga memiliki variasi dalam ukuran dan nada, yang masing-masing digunakan untuk fungsi yang berbeda dalam ensambel gamelan.","assets/images/bonang.png",A.a(["assets/image_detail/bonang1.jpeg","assets/image_detail/bonang2.jpg","assets/image_detail/bonang3.jpeg"],k),"Bonang",p,m,"assets/thumbnail/bonang.png"),A.hL(o,"Kendang adalah alat musik perkusi yang berbentuk drum dan terbuat dari kayu serta kulit hewan. Alat musik ini dimainkan dengan tangan atau pemukul, menghasilkan suara yang ritmis dan berirama. Kendang sering digunakan dalam ensambel gamelan untuk mengatur tempo dan memberi penekanan pada bagian-bagian tertentu dari komposisi musik.","Kendang memiliki sejarah panjang dan merupakan bagian integral dari gamelan Jawa dan Bali. Sejak zaman dahulu, kendang digunakan dalam upacara keagamaan, tari-tarian, dan pertunjukan wayang. Kendang juga memiliki berbagai ukuran dan jenis, masing-masing dengan fungsi yang berbeda dalam ensambel gamelan. Hingga kini, kendang tetap menjadi alat musik yang sangat penting dalam budaya musik tradisional Indonesia.","assets/images/kendang.png",A.a(["assets/image_detail/kendang1.png","assets/image_detail/kendang2.png","assets/image_detail/kendang3.png"],k),"Kendang","Jawa dan Bali",m,"assets/thumbnail/kendang.jpg"),A.hL(o,"Talempong adalah alat musik perkusi yang terbuat dari logam, berbentuk seperti gong kecil, dan disusun secara horizontal. Alat musik ini dimainkan dengan cara dipukul menggunakan palu kayu, menghasilkan suara yang berirama dan harmonis. Talempong sering dimainkan dalam ansambel musik tradisional Minangkabau untuk mengiringi tarian, nyanyian, atau upacara adat.","Talempong sudah ada sejak zaman kerajaan di Minangkabau dan merupakan salah satu alat musik yang penting dalam budaya masyarakat Minangkabau. Alat musik ini sering dimainkan dalam acara-acara adat seperti pesta pernikahan, upacara keagamaan, dan acara resmi lainnya. Talempong juga memiliki peran penting dalam mengiringi tari-tarian tradisional Minangkabau seperti Tari Piring dan Tari Payung.","assets/images/talempong.png",A.a(["assets/image_detail/talempong1.png","assets/image_detail/talempong2.png","assets/image_detail/talempong3.png"],k),"Talempong",l,m,"assets/thumbnail/talempong.jpg"),A.hL(o,"Calung adalah alat musik tradisional yang terbuat dari bambu dan dimainkan dengan cara dipukul. Alat musik ini terdiri dari beberapa tabung bambu yang disusun secara horizontal dan dirangkai dengan tali. Calung menghasilkan nada-nada yang ceria dan sering digunakan dalam pertunjukan musik tradisional Sunda.","Calung berasal dari Jawa Barat dan telah menjadi bagian dari budaya musik Sunda sejak zaman dahulu. Alat musik ini sering digunakan dalam berbagai acara kebudayaan, seperti pesta rakyat dan upacara adat. Selain itu, calung juga digunakan dalam pertunjukan seni tradisional Sunda seperti kliningan dan angklung. Meskipun sederhana, calung memiliki peran penting dalam menjaga dan melestarikan budaya musik tradisional Sunda.","assets/images/calung.png",A.a(["assets/image_detail/calung1.png","assets/image_detail/calung2.png","assets/image_detail/calung3.png"],k),"Calung",q,m,"assets/thumbnail/calung.jpg"),A.hL(n,"Sape adalah alat musik dawai tradisional yang berasal dari suku Dayak di Kalimantan. Alat musik ini terbuat dari kayu dengan senar yang terbuat dari serat alami atau nilon. Sape dimainkan dengan cara dipetik, menghasilkan melodi yang lembut dan menghanyutkan. Alat musik ini sering dimainkan dalam upacara adat dan tarian tradisional Dayak.","Sape telah menjadi bagian dari kehidupan masyarakat Dayak sejak zaman dahulu. Alat musik ini tidak hanya digunakan sebagai alat musik, tetapi juga sebagai simbol spiritual dalam upacara adat dan ritual keagamaan. Sape dipercaya dapat menghubungkan manusia dengan dunia roh, sehingga sering dimainkan dalam upacara-upacara penting. Hingga kini, sape tetap menjadi alat musik yang dihormati dan dilestarikan oleh masyarakat Dayak.","assets/images/sape.png",A.a(["assets/image_detail/sape1.png","assets/image_detail/sape2.png","assets/image_detail/sape3.png"],k),"Sape","Kalimantan",m,"assets/thumbnail/sape.jpg"),A.hL(o,"Aramba adalah alat musik perkusi yang berbentuk seperti gong dan terbuat dari logam. Alat musik ini dimainkan dengan cara dipukul menggunakan pemukul kayu. Aramba menghasilkan suara yang dalam dan menggema, sering digunakan dalam upacara adat dan pertunjukan musik tradisional di Nias.","Aramba telah menjadi bagian dari budaya masyarakat Nias sejak zaman dahulu. Alat musik ini sering digunakan dalam upacara adat seperti pesta pernikahan, upacara kematian, dan upacara keagamaan. Aramba juga dianggap sebagai simbol kekuatan dan kehormatan dalam masyarakat Nias, sehingga sering dimainkan dalam acara-acara penting. Hingga kini, aramba tetap menjadi alat musik yang dihormati dan dilestarikan oleh masyarakat Nias.","assets/images/aramba.png",A.a(["assets/image_detail/aramba1.png","assets/image_detail/aramba2.png","assets/image_detail/aramba3.png"],k),"Aramba","Nias",m,"assets/thumbnail/aramba.jpg")],A.at("D<SO>"))})
